import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="row">
        <div>
          <input placeholder="Search"/>
        </div>
      </div>
      <div className="row">
        <div>
          San Francisco, CA
        </div>
      </div>
      <div className="row">
      </div>
      <div className="row">
      </div>
    </div>
  );
}

export default App;
